var quiz = document.getElementById("quiz");

var questions = '';

for (let i = 0; i < questionData.data[0].questions.length; i++) {
    const question = questionData.data[0].questions[i];
    var h2 = `<h2 class="question">${question.name}</h2>`;

    var answerList = question.answers.map(answer => answer.option).join("<br/>");

    var questionHTML = h2 + answerList + "<br/>";

    questions = questions + questionHTML;
}

quiz.innerHTML = questions;

